    "# Memories: Photo Management for Nextcloud\n\nMemories is a *batteries-included* photo management solution for Nextcloud with advanced features including:\n\n- **📸 Timeline**: Sort photos and videos by date taken, parsed from Exif data.\n- **⏪ Rewind**: Jump to any time in the past instantly and relive your memories.\n- **🤖 AI Tagging**: Group photos by people and objects, powered by [recognize](https://github.com/nextcloud/recognize) and [facerecognition](https://github.com/matiasdelellis/facerecognition).\n- **🖼️ Albums**: Create albums to group photos and videos together. Then share these albums with others.\n- **🫱🏻‍🫲🏻 External Sharing**: Share photos and videos with people outside of your Nextcloud instance.\n- **📱 Mobile Support**: Work from any device, of any shape and size through the web app.\n- **✏️ Edit Metadata**: Edit dates and other metadata on photos quickly and in bulk.\n- **📦 Archive**: Store photos you don't want to see in your timeline in a separate folder.\n- **📹 Video Transcoding**: Transcode videos and use HLS for maximal performance.\n- **🗺️ Map**: View your photos on a map, tagged with accurate reverse geocoding.\n- **📦 Migration**: Migrate easily from Nextcloud Photos and Google Takeout.\n- **⚡️ Performance**: Do all this very fast.\n\n## 🚀 Installation\n\n1. Install the app from the Nextcloud app store (try a demo [here](https://demo.memories.gallery/apps/memories/)).\n1. Perform the recommended [configuration steps](https://memories.gallery/config/).\n1. Run `php occ memories:index` to generate metadata indices for existing photos.\n1. Open the 📷 Memories app in Nextcloud and set the directory containing your photos." : "# Wspomnienia (Memories): Zarządzanie zdjęciami dla Nextcloud\n\nWspomnienia to *zawierające baterie* rozwiązanie do zarządzania zdjęciami dla Nextcloud z zaawansowanymi funkcjami, w tym:\n\n- **📸 Oś czasu**: Sortowanie zdjęć i filmów według daty wykonania, analizowane na podstawie danych Exif.\n- **⏪ Przewijanie do tyłu**: Natychmiastowy skok do dowolnego momentu w przeszłości i ponowne przeżywanie wspomnień.\n- **🤖 Tagowanie AI**: Grupuj zdjęcia według osób i obiektów, korzystając z funkcji [recognize](https://github.com/nextcloud/recognize) i [facerecognition](https://github.com/matiasdelellis/facerecognition).\n- **🖼️ Albumy**: Twórz albumy, aby grupować zdjęcia i filmy. Następnie udostępniaj te albumy innym osobom.\n- **🫱🏻‍🫲🏻 Udostępnianie zewnętrzne**: Udostępniaj zdjęcia i filmy osobom spoza instancji Nextcloud.\n- Wsparcie mobilne**: Pracuj z dowolnego urządzenia, o dowolnym kształcie i rozmiarze za pośrednictwem aplikacji internetowej.\n- **✏️ Edytuj metadane**: Edytuj daty i inne metadane na zdjęciach szybko i masowo.\n- Archiwum**: Przechowuj zdjęcia, których nie chcesz widzieć na osi czasu, w osobnym katalogu.\n- Transkodowanie wideo**: Transkoduj wideo i używaj HLS dla maksymalnej wydajności.\n- **🗺️ Map**: Wyświetlaj swoje zdjęcia na mapie, oznaczone dokładnym odwrotnym geokodowaniem.\n- Migracja**: Łatwa migracja ze Zdjęć Nextcloud i Google Takeout.\n- **⚡️ Wydajność**: Rób to wszystko bardzo szybko.\n\n# 🚀 Instalacja\n\n1. Zainstaluj aplikację ze sklepu z aplikacjami Nextcloud (wypróbuj wersję demonstracyjną [tutaj](https://demo.memories.gallery/apps/memories/)).\n1. Wykonaj zalecane [kroki konfiguracji](https://memories.gallery/config/).\n1. Uruchom `php occ memories:index`, aby wygenerować indeksy metadanych dla istniejących zdjęć.\n1. Otwórz aplikację 📷 Wspomnienia w Nextcloud i ustaw katalog zawierający zdjęcia.",
